import React from 'react';

//{name}는 Food의 object
function Food({fav}){
  return <h3>I love {fav}</h3>;
}

const FoodILike = [
  {
    id:1,
    name: "Kimchi",
    image:
    "https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.F_ojzEqFOvx9NEuIr6Ut9gHaFD%26pid%3DApi&f=1"
  },
  {
    id:2,
    name: "gogi",
    image:
    "https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.v0RiALj-qb0tA3TaocYnVAHaE7%26pid%3DApi&f=1"
  },
  {
    name: "hamburger",
    image:
    "https://www.google.com/imgres?imgurl=https%3A%2F%2Fimage-cdn.hypb.st%2Fhttps%253A%252F%252Fkr.hypebeast.com%252Ffiles%252F2019%252F09%252Fmcdonalds-beyond-meat-plant-plt-burger-000-1.jpg%3Fq%3D75%26w%3D800%26cbr%3D1%26fit%3Dmax&imgrefurl=https%3A%2F%2Fhypebeast.kr%2F2019%2F9%2Fmcdonalds-beyond-meat-collaboration-plt-plant-burger-canada-test-info&tbnid=GsxAM5XotNx6yM&vet=12ahUKEwjisq-3ssXuAhWux4sBHXoQB6MQMygFegUIARDdAQ..i&docid=N1LXmz0N9HcosM&w=800&h=534&q=%ED%96%84%EB%B2%84%EA%B1%B0&ved=2ahUKEwjisq-3ssXuAhWux4sBHXoQB6MQMygFegUIARDdAQ"
  }
];

//JSX = Javascript + HTML
//index.html로 뿌리지 않고 component로 접근하기 때문에 속도 증가
function App() { 
  return (
    <div className="App">
      {FoodILike.map( dish => <Food fav={dish.name} />)};
    </div>
  );
}

export default App;
